import React from 'react';
import './Body.css';
import FileUploder from './fileupload';
import './fileUpload.css';

import CloudUploadIcon from '@material-ui/icons/CloudUpload';
import { Button } from '@material-ui/core';

function Body({ handleUploadFile }) {

    return (
        <>
            <div className='file_upload'>
                <div className='file_border'>
                    <Button
                        className='input_button'
                        variant="contained"
                        component="label"
                    >
                        <CloudUploadIcon className='upload_icon' />
                        <span className='upload_lable'>Upload</span>
                        <input onChange={(event) => handleUploadFile} className='file_input'
                            type="file"
                        />
                    </Button>
                </div>
            </div>
            {/* <div className='body'>
                <FileUploder handleUploadFile={handleUploadFile()} />
            </div> */}
        </>
    )
}

export default Body;
